/**
 * Convert the current time to another measure.
 * 
 * @inheritDoc
 */
ilib.Measurement.Time.prototype.convert = function(to) {
	if (!to || typeof(ilib.Measurement.Time.ratios[this.normalizeUnits(to)]) === 'undefined') {
		return undefined;
	}
	return new ilib.Measurement({
		unit: to,
		amount: this
	});
};

